INSERT INTO `ninja_skill` (`id`, `name`, `thongtin`, `dame`, `mp`, `hp`, `idninja`, `hpthem`, `mpthem`, `time`, `idskill`, `level`) VALUES
(1, 'Ouchia', 'Quạt mạnh tạo ra luồng gió tấn công thẳng vào một mục tiêu, gây sát thương lên mục tiêu đó.', 260, 15, 0, 4, 0, 0, 1, 1, 5),
(2, 'Tatsumaki', 'Tạo ra các cơn gió lốc và sấm sét, gây sát thương lớn lên các mục tiêu nhất định, tối đa 4 mục tiêu.', 380, 108, 0, 4, 0, 0, 1, 2, 15),
(3, 'Bakkuuchiha', 'Ném quạt xoay vòng trước mắt gây sát thương lên các mục tiêu lân cận, tối đa 3 mục tiêu.', 410, 76, 0, 4, 0, 0, 1, 3, 20),
(4, 'Suishou', 'Hồi phục cho bản thân và đồng đội một lượng máu nhất định.', 0, 200, 0, 4, 1500, 750, 12, 4, 10),
(5, 'Sogekihei', 'Nhẫn thuật tiêu tốn MP giảm sức sát thương của quái vật lên bản thân.', 60, 100, 0, 1, 0, 0, 1, 1, 5),
(6, 'Uzusa', 'Cung thuật nhập môn - bắn một mũi tên gây sát thương lên một mục tiêu nhất định.', 115, 2, 0, 1, 0, 0, 1, 2, 10),
(7, 'Kogosa', 'Băng thuật cô đọng hơi nước xung quanh tạo ra mũi tên băng bắn vào kẻ địch, gây sát thương cực lớn.\r\n', 200, 420, 0, 1, 0, 0, 20, 4, 20),
(8, 'Nikinkinsa', 'Bắn ra 2 mũi tên băng gây sát thương trong một phạm vi nhất định, sát thương tối đa 3 mục tiêu.\r\n', 170, 58, 0, 1, 0, 0, 1, 3, 15),
(9, 'Hiyoko', 'Kiếm pháp nhập môn - vung kiếm vào một mục tiêu gây sát thương lên mục tiêu đó.\r\n', 160, 15, 0, 3, 0, 0, 1, 1, 5),
(10, 'Kakyuu', 'Sử dụng hỏa thuật thiêu đốt quái vật biến chúng thành thức ăn.\r\n', 120, 50, 0, 3, 0, 0, 1, 2, 10),
(11, 'Choukouhirenzo\r\n\r\n', 'Xuất ra 3 hỏa kiếm cường mạnh gây sát thương trong một phạm vi nhất định, tối đa 4 mục tiêu.\r\n', 300, 88, 0, 3, 0, 0, 1, 3, 15),
(12, 'Hihebun', 'Tạo ra cơn mưa kiếm, gây sát thương cực lớn lên một mục tiêu.\r\n', 200, 160, 0, 3, 0, 0, 19, 4, 20),
(13, 'Hayateto', 'Nhát chém kèm theo gió và sấm sét giáng thẳng vào mục tiêu, gây ra sát thương cực lớn.\r\n', 135, 160, 0, 2, 0, 0, 20, 3, 15),
(14, 'Magumandari', 'Khiến cho quái vật bị tác động không thể tấn công trong một thời gian nhất định.\r\n', 0, 30, 0, 2, 0, 0, 13, 2, 10),
(15, 'Chousouto', 'Kết hợp phong thuật vung đao về phía kẻ địch gây sát thương trong phạm vi nhất định, sát thương tối đa 3 mục tiêu', 230, 46, 0, 2, 0, 0, 1, 4, 20),
(16, 'Enchokuto', 'Đao pháp nhập môn - dùng đao chém mạnh vào một mục tiêu gây sát thương lên mục tiêu đó.\r\n', 105, 1, 0, 2, 0, 0, 1, 1, 5);
