INSERT INTO `shopninja` (`id`, `name`, `thongtin`, `dame`, `exp`, `lv`, `mp`, `mpfull`, `hp`, `hpfull`, `time`, `gia`, `check`, `hpthem`, `mpthem`, `phandame`, `phongthu`) VALUES
(1, 'Ninja Cung', 'Dame cao, tấn công siêu chậm.', 20, 0, 0, 500, 500, 1000, 1000, NULL, 2000, 0, 500, 250, 10, 10),
(2, 'Ninja Đao', 'Ninja Đao thuộc hệ Phong, là một đấu sĩ cận chiến với khả năng phòng thủ tầm trung, HP cao và sát thương cao, nhưng lại có tốc độ đánh khá chậm. Khả năng tốt nhất của Ninja Đao là dịch chuyển tiếp cận, làm choáng và khống chế đối phương. Khả năng này có được là nhờ chiêu Aisubaagu và Baasutosumootu. Ninja Đao được xếp hạng theo các khả năng như sau:  Xét về phòng thủ, Ninja Đao phòng thủ đứng thứ 3 trong 4 class, đứng thứ 2 trong lớp Ngoại công. Xét về khả năng đặc biệt, Ninja Đao đứng thứ 1 trong 4 class có khả năng khống chế.', 30, 0, 0, 500, 500, 1000, 1000, NULL, 2000, 0, 500, 250, 10, 10),
(3, 'Ninja Kiếm', 'Ninja Kiếm thuộc hệ Hỏa dạng Ngoại công, được đánh giá là một đấu sĩ cận chiến với khả năng phòng thủ và tỉ lệ chí mạng cao. Do đó, khả năng tốt nhất của Ninja Kiếm là đánh nhanh thắng nhanh. Khả năng này có được là nhờ chiêu Raikou và sự hỗ trợ của chiêu Pawaraikou. Ninja Kiếm được xếp hạng theo các khả năng như sau:  Ninja phòng thủ tốt nhất trong 4 phái, cũng như tốt nhất trong nhóm Ngoại công. Ninja có khả năng tàng hình lâu nhất trong hai lớp Ninja có khả năng tàng hình.', 15, 0, 0, 500, 500, 1000, 1000, NULL, 2000, 0, 500, 250, 10, 30),
(4, 'Ninja Quạt', 'Ninja Quạt thuộc hệ Phong dạng Nội công, là class ninja duy nhất trong 4 class mang trong mình những skill mang tính hỗ trợ đồng đội. Class này được đánh giá là một đấu sĩ hỗ trợ với đặc điểm như HP cao, sát thương trung bình, nhưng tốc độ đánh chậm. Khả năng tốt nhất của Ninja Quạt là trợ giúp đồng đội bằng khả năng đặc biệt của mình như hồi máu, tăng chỉ số kháng, tăng chỉ số sát thương, giảm trừ sát thương nhận phải,... thậm chí là hồi sinh đồng đội bị kiệt sức. Khả năng này có được là nhờ chiêu Suishou và Hayatemi. Ninja Quạt được xếp hạng theo các khả năng như sau:  Xét về phòng thủ, Ninja Quạt phòng thủ đứng thứ 2 trong 4 class, đứng thứ 1 trong lớp Nội công. Xét về khả năng đặc biệt, Ninja Quạt là class duy nhất có khả năng hỗ trợ đồng đội.', 10, 0, 0, 500, 500, 2000, 2000, NULL, 2000, 0, 500, 250, 10, 20);
